import React from "react";
import "./Navbar.css";
function Navbar() {
  return (
    <>
      <nav className="nav-wrapper">
        <div>
          <img></img>
          <ul>
            <li></li>
          </ul>
        </div>
      </nav>
    </>
  );
}

export default Navbar;
